INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 1, 40011, "リリ", 0, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 24001, 1, 321, 125801, 1);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 1, 40011, "クリア", 0, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 24001, 2, 322, 126001, 1);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 1, 40011, "プレシア", 0, "んーと。\nこれ、あげる。\nはい", 24001, 3, 323, 126101, 1);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 1, 40011, "リリ", 0, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 24001, 4, 324, 125801, 2);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 1, 40011, "クリア", 0, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 24001, 5, 325, 126001, 2);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 1, 40011, "プレシア", 0, "お兄。\nきてくれて、うれしい", 24001, 6, 326, 126101, 2);
